Subtask 2.2   Monthly Project Status Meeting. The Subcontractor will participate, as needed in monthly project status meetings with Public Strategies and the Prime Client. Anticipate twelve (12) one-hour calls.
 Subtask 3.21   National Topic Centered Meeting. The Subcontractor will collaborate with MDRC to assist Public Strategies in the planning and delivery of one (1) National Topic Centered Meetings during the contract period. Public Strategies will handle logistics and be responsible for payment of any expert consultants identified to present during the meeting.  For this subtask, the Subcontractor will:
   Plan for Senior Advisor and EMPath Lead to attend a one (1)-day planning meeting in Washington, D.C.;
   Provide content materials and co-facilitate at the meeting;
   Staff the meeting with two (2) Executives and two to three (2-3) coaches anticipated to work with local sites;
   Budget all travel for staff for the planning meeting (anticipate 1 night) and National Topic-Centered Meeting (anticipate 2 nights) and per diem at $201 for lodging and $69 M&IE.
 Timing of the National Topic-Centered Meeting is to be determined by Public Strategies and OFA COR and is currently set for February, 2018.
 Subtask 3.22   Learning Community. The subcontractor will lead the TTA activities, in conjunction with Public Strategies, for six (6) of the ten (10) sites participating in the Learning Community. TTA activities will launch at the National Topic Centered Meeting and throughout the remainder of the contract year and will include providing relevant written resources/toolkits to sites, monthly calls with each site, periodic webinars, and two (2) site visits to each site. The EMPath coach is considered the Subject Matter Expert (SME) at each site for the TTA team.
 Subtask 3.24   Content-relevant Coaching. The subcontractor will assist Public Strategies in developing a virtual database of content-relevant TTA Coaches responsible for providing one-on-one support to TTA sites. Activities involved in the development of the virtual database include creating criteria for Coaches based on specific content areas determined by OFA and seeking guidance from experts related to identifying skilled and credentialed professionals with content and technical knowledge.

